                        new GradientStop(){ Color= "white", Offset=0},
                        new GradientStop(){Color ="#6BA5D7", Offset=100}
                    }
            };

        }
        else
        {
            connector.Style.Gradient = new RadialGradient()
            {
                Type = GradientType.Radial,
                Cx = 50,
                Cy = 50,
                Fx = 50,
                Fy = 50,
                Stops = new DiagramObjectCollection<GradientStop>()
                    {
